import React from "react";
import { Switch, Route } from "react-router-dom";
import Home from "./pages/Home";

// import "./App.css";
import ProductPage from "./pages/ProductPage/ProductPage";
import Product from "./components/Product/Product";

function App() {
  return (
    <Switch>
      <Route path="/product/">
        <ProductPage />
      </Route>
      <Route path="/">
        {/* <Home /> */}
        <Product />
      </Route>
    </Switch>
  );
}

export default App;
